    render() {
        return (
                <div className="col-xs-3 col-sm-3 col-md-3 col-lg-3">
					<div className="thumbnail">
					<img alt="pic-1" src={pic1} className="items" />
						<div className="caption">
							<h3>
								aaaa
							</h3>
							<p>
								aaaa
							</p>
						</div>
						<div className="buy">
							<p>
								<a> <img src={addtocart} alt="addtocart" /> </a>
							</p>
						</div>
					</div>
				</div>
        );
    }
}

export default Items;
